export const siteData = {
  "title": "野 岭",
  "description": "Vuepress blog demo",
  "base": "/blog-demo/",
  "pages": [
    {
      "key": "v-97da6f8ab01d6",
      "path": "/",
      "title": "Home",
      "frontmatter": {
        "home": true,
        "heroImage": "/6.png",
        "heroText": "周岚",
        "tagline": "Dec Wan",
        "actionText": "首页",
        "actionLink": "/"
      }
    },
    {
      "key": "v-9c84ce7a9d9d5",
      "path": "/blog/FirstBlog.html",
      "title": "我的第一篇博客"
    }
  ],
  "themeConfig": {
    "repo": "https://github.com/xxxxxxx/blog-demo",
    "repoLabel": "My GitHub",
    "nav": [
      {
        "text": "Home",
        "link": "/"
      },
      {
        "text": "FirstBlog",
        "link": "/blog/FirstBlog.md"
      }
    ],
    "sidebar": [
      [
        "/",
        "首页"
      ],
      [
        "/blog/FirstBlog.md",
        "我的第一篇博客"
      ]
    ]
  }
}
